.0
1.

.5
-.5
.0
1.
.0

.5
.5
.0
1.
1.

DBO_DATA:
.2		; a vec4
.2
.2
.2
5.		; time variable

Q_SUBMITS: 	; must be 14 bytes
H 0 ; 2
W 0 ; 6
D 0 ; 14

PUSH_INFO:
D 0		; data buffer ID
D 0		; offset into data buffer
B 19	; number of bytes to update

CLEAR_COLOR:
.05
.05
.05
1.

CLEAR_DEPTH:
1.

ATTRIB_LAYOUT_DATA:
H 1 		; # of attributes
D 20 		; vtx stride

H 2 		; attrib ID
D 0 		; attrib offset
B 2 		; attrib fmt

H 3 		; attrib ID
D #C 		; attrib offset
B 1 		; attrib fmt

DRAW_CALL_DATA:
B 0 		; is indexed draw call?
W 6 		; # of indices
W 0 		; starting index
W 0 		; # of instances

